package xq.foundation;

import com.alibaba.fastjson.JSONObject;
import org.apache.thrift.TException;
import org.apache.thrift.protocol.TBinaryProtocol;
import org.apache.thrift.protocol.TProtocol;
import org.apache.thrift.transport.TSocket;
import org.apache.thrift.transport.TTransport;
import xq.foundation.thrift.ThriftCmdStruct;
import xq.foundation.thrift.ThriftResultStrcut;
import xq.foundation.thrift.ThriftService;

import java.nio.ByteBuffer;
import java.util.Base64;

/**
 * Created by yaoyao on 2019/9/18.
 */
public class ThriftClient {

    public static void main(String[] args) {

        TTransport transport = new TSocket("192.168.10.140",12100, 30*1000);
        TProtocol protocol = new TBinaryProtocol(transport);
        ThriftService.Client client = new ThriftService.Client(protocol);

        ThriftCmdStruct inParam=new ThriftCmdStruct();
        inParam.param=String.valueOf(1);
        String img = "";
        inParam.imgA= ByteBuffer.wrap(Base64.getDecoder().decode(img));
        try {
            System.out.println("body:" + JSONObject.toJSONString(inParam));
            ThriftResultStrcut result = client.doProcess("/face/tool/detect","XQ_20100927",inParam);
        } catch (TException e) {
            e.printStackTrace();
        }
    }

}
